015-06-15 17:57:13','2015-06-17 15:30:36'),(21,'公告新增','老中医的忠告！有一个从医六十多年的老大夫建议，在学校工作的同志，夏天应该少开车，多坐公交或者步行，少喝饮料，多喝点白开水，在家尽量不要用空调，不要在外面吃饭，特别是吃烧烤。几番追究原由，老中医无奈直言道： 因为你们挣的太少了！','',1,1,'2015-06-18 14:50:16',1,'2015-06-18 14:50:16','2015-06-25 00:00:00'),(22,'公告新增','老中医的忠告！','',1,1,'2015-06-18 14:50:47',1,'2015-06-18 14:50:47','2015-06-25 00:00:00'),(23,'公告新增','老中医的忠告！','',1,1,'2015-06-18 14:51:01',1,'2015-06-18 14:51:01','2015-06-25 00:00:00'),(24,'顶戴sd','asdfasdf','',1,1,'2015-06-18 14:51:13',1,'2015-06-18 14:51:13','2015-06-25 00:00:00'),(25,'test1','test2',',1,',1,1,'2015-06-18 14:55:54',1,'2015-06-18 14:55:54','2015-06-25 00:00:00'),(26,'老中医的忠告','老中医的忠告！有一个从医六十多年的老大夫建议，在学校工作的同志，夏天应该少开车，多坐公交或者步行，少喝饮料，多喝点白开水，在家尽量不要用空调，不要在外面吃饭，特别是吃烧烤。几番追究原由，老中医无奈直言道： 因为你们挣的太少了！',',1,',1,1,'2015-06-18 15:06:39',1,'2015-06-18 15:06:39','2015-06-18 00:00:00'),(27,'没参加高考，却参加了高考的狂欢','是否还记得你当年的数学高考。那是个温暖午后，你坐在考场，轻轻闭上眼，深呼吸。听着大家笔锋与试卷摩擦的沙沙，听着墙上时钟的嘀嗒，听着自己内心的无数个草泥妈，度过了安静祥和的两小时。阳光透过窗帘洒进教室的那一瞬，试卷大题部分的空白，与你大脑的空白，交相辉映。。。这么巧，我也是这样。',',1,,5,',1,1,'2015-06-18 15:21:37',1,'2015-06-18 15:29:20',NULL),(28,'高考作文','1、原来广东卷的高考作文是《感知自然》。我想还大吃省呢，连孜然都不知道。  2、四川高考作文题：《老实与聪明》。上午考完语文，段子手是聪明的，下午考完数学，段子手都是老实的。  3、看到东北高考作文题《告诉自己，我能行》后不由得虎躯一震！我不用去男科医院了。',',1,,2,,5,',1,1,'2015-06-18 15:41:04',1,'2015-06-18 15:41:04',NULL),(29,'趣语话生活，极具幽默感1','1、记得前几年单身还被说是贵族的，怎么现在就TM变成狗了。  2、好人要想成佛，得经过九九八十一难。坏人要想成佛就简单的多了，放下屠刀立地成佛。。。  3、所谓粉丝，就是一群缺钱的人养着一群不差钱的人。  4、如果你也有个喜欢熬夜的朋友，请好好珍惜他，因为也许不知道什么时候，他就死了。。。  5、长辈以前总对我们说网上都是骗人的，结果现在自己却狂转朋友圈里的造谣贴。',',1,',1,1,'2015-06-18 17:23:26',1,'2015-06-18 17:24:49','2015-06-26 00:00:00'),(30,'短公告','hello world',',1,',1,1,'2015-06-18 20:49:29',1,'2015-06-18 20:49:29',NULL),(31,'怎么打造一个团结互助、士气高涨的团队。','刚开始创业合伙人团队打造好了还不够。因为事情一多了就需要扩展整个团队，不可能所有事情创始人都能够搞定，团队的战斗力直接影响了整个公司的战斗力。我觉得一个团队最基本的就是要互相信赖，不只是合伙人需要信赖，整体团队也需要。合伙人都不信任就别开公司了，团队不信任合作会举步维艰，推动不了任何事情。信任包括同事对同事、上级对下级、下级对上级，任何一个环节都很重要。',',1,',1,1,'2015-06-19 11:00:55',1,'2015-06-19 11:02:01','2015-06-27 00:00:00'),(32,'他说他1','他说他1',',227,,65,,135,,141,,91,,92,',-1,1,'2015-06-21 16:23:54',1,'2015-06-21 16:23:54',NULL);
